class PPCPaymentLogger{static LOGLEVEL_ERROR=1;static LOGLEVEL_NOTICE=2;static LOGLEVEL_DEBUG=3;constructor(paymentClass,logLevel){this.paymentClass=paymentClass;this.logLevel=logLevel?logLevel:PPCPaymentLogger.LOGLEVEL_ERROR}async log(level,msg,data){if(this.logLevel<level){return}let context={};let params={paymentClass:this.paymentClass,data:data};ppcpIOManagedCall("jtl_paypal_commerce.logState",[level,msg,params],context)}async debug(msg,data){return this.log(PPCPaymentLogger.LOGLEVEL_DEBUG,msg,data)}async warn(msg,data){return this.log(PPCPaymentLogger.LOGLEVEL_NOTICE,msg,data)}async err(msg,data){return this.log(PPCPaymentLogger.LOGLEVEL_ERROR,msg,data)}}